import React, {useState} from 'react';
import Navigation from './smallComponents/Navigation'

export default function Header() {
    const [menuActive, setMenuActive] = useState(false);

    return (
        <>
            <header className="header">
                <img className="site-logo" src='/static/logo.png'/>
                <div className={`menu-container ${menuActive && 'active'}`}>
                    <Navigation/>
                </div>

                <svg src="/static/ui/hamburger-icon.svg" className="menu-icon" onClick={()=> setMenuActive(!menuActive)}/>
            </header>


            <svg xmlns="http://www.w3.org/2000/svg" width="643" height="643" viewBox="0 0 100 100" fill="none">
	<path d="M92.5,25h-85C3.36,25,0,21.64,0,17.5v0C0,13.36,3.36,10,7.5,10h85c4.14,0,7.5,3.36,7.5,7.5v0C100,21.64,96.64,25,92.5,25z" fill="#000"/>
	<path d="M92.5,86h-85C3.36,86,0,82.64,0,78.5v0C0,74.36,3.36,71,7.5,71h85c4.14,0,7.5,3.36,7.5,7.5v0C100,82.64,96.64,86,92.5,86z" fill="#000"/>
	<path d="M92.5,56h-85C3.36,56,0,52.64,0,48.5v0C0,44.36,3.36,41,7.5,41h85c4.14,0,7.5,3.36,7.5,7.5v0C100,52.64,96.64,56,92.5,56z" fill="#000"/>
</svg>         
            <div className="header-spacer"></div>
        </>
    ) // not all browsers support position:sticky;
}




